import { useContext } from "react"
import React   from 'react'
import { StateContext} from '../../context/AppProvider'

const AddtoCart = ({cartitems , deletCartItem})=>{

    const Cartpakag = useContext(StateContext)

    let addcartresult = cartitems.map((item)=>{
        return(
           <div>
                <h5>{item.title}</h5>
                <img src={item.img} alt="" />
                <h1 className="add-t-cart-item-delete-h1" onClick={()=>deletCartItem(item.id)}>Delete</h1>
                <h2>Rs:- 299/-</h2>


            </div>
        )
    })

    return(
        <div className="add-to-cart-wrappr">
            <div className="container">
            <div className="add-t-cart-item">
             <h4>Your Cart</h4>
                {addcartresult}
            </div>
            </div>
        </div>

    )
}


export default AddtoCart
